import Navbar from "./Navbar";
import code from "../images/code.jpg";

export const HomePage = () => {
  return (
    <div className='home-wrapper' >
      <img className='home-wrapper-image' src={code} alt="code" />
    </div>
  );
};

export default HomePage;
